import React, { Component } from "react";
import Head from "next/head";

class Index extends Component {
  render() {
    return (
      <div>
        <Head>
          <title>Laptop Arsenal</title>
          <meta
            name="viewport"
            content="initial-scale=1.0, width=device-width"
          />
        </Head>
      </div>
    );
  }
}

export default index;
